import React from 'react';
import {Button, Container} from "react-bootstrap";

const AdminPage = () => {
    return (
        <Container>
            <Button>Добавити новий тип</Button>
            <Button>Добавити новий бранд</Button>
            <Button>Добавити новий девайс</Button>
        </Container>
    );
};

export default AdminPage;
